function Education() {
    return (
        <div>
            <h1>Education</h1>
            <input type="text" placeholder="University Name"/>
            <input type="text" placeholder="Degree"/>
            <input type="text" placeholder="From"/>
            <input type="text" placeholder="Expected"/>
        </div>
    )
}

export default Education;
